import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from "./components/authentication/Login";
import Signup from "./components/authentication/Signup";
import Verifycode from "./components/authentication/Verifycode";
import Requestcode from "./components/authentication/Requestcode";
import HeaderData from "./components/Headerdata/HeaderData";
import Home from "./components/Home";
function App() {
  return (
    <BrowserRouter>
      <HeaderData>
        <Routes>
          {/* <Route path="/login" element={Login} /> */}
          {/* <Route path="/signup" element={Signup} /> */}
          {/* <Route path="/verify" element={Verifycode} /> */}
          {/* <Route path="/requestcode" element={Requestcode} /> */}
          {/* <Route path="/forgotpassword" element={ForgotPassword} /> */}
          <Route path="/" element={Home} />
          <Route path="/favourites/:id" element={<Favourites />} />
        </Routes>
      </HeaderData>
    </BrowserRouter>
  );
}

export default App;
